def histogram(test):
    """Given a string representing a space separated lowercase letters, return a dictionary
    of the letter with the most repetition and containing the corresponding count.
    If several letters have the same occurrence, return all of them.

    Example:
    histogram('a b c') == {'a': 1, 'b': 1, 'c': 1}
    histogram('a b b a') == {'a': 2, 'b': 2}
    histogram('a b c a b') == {'a': 2, 'b': 2}
    histogram('b b b b a') == {'b': 4}
    histogram('') == {}

    """

    # Split the input into individual characters (histogram_input)
    histogram_input = test.split(" ")

    # Initialize an empty dictionary to store the results in (histogram_dict)
    histogram_dict = dict()

    # Loop through each character in the list created above
    for char in histogram_input:
        if char in histogram_dict:
            histogram_dict[char] += 1
        else:
            histogram_dict[histogram_input] = 0
